import Table from "./Table";
import data from "./data.json";

const DashboardUser = () => {
    return (
        <div className="App">
          <Header />
          <div>
            <Link user="test" />
            <Cards c1="23" c2="12" c3="2"/>
            <Table data={data}/>
          </div>
          <Footer />
        </div>
      );
}

export default DashboardUser;
